    return (
    <>
    <table id="example" className="table table-striped table-bordered" style={{width:"100%"}}>
        <thead>
            <tr>
                <th>Id</th>
                <th>Name</th>
            </tr>
        </thead>
        <tbody>
        {
          stuList.map((val) => {
            if (cls === val.class) {
              return (
                <>
                    <tr>
                        <td>{val.id}</td>
                        <td>{val.name}</td>
                        <td>More..</td>
                    </tr>
                </>
              )
            }
            else
              return null

          })
        }
        </tbody>
    </table>

    </>
  )
}
